%% DECISION VARIABLES AND UNCERTAIN PARAMETERS FOR ALL TECHNOLOGIES
%3. Decision Variables and Uncertain Parameters for all Technologies
    %Heat exchange efficiency uniform distribution from 0.5 to 0.7
        %Heat exchanger matrix 10,000 determined from lhsu below. Fixed to
        %shorten computational time
